import React, { Component } from 'react';
import ComicList from './comicList.js';
import './flexbox.css';

class ProfileUI extends Component {
    // constructor() {
    //     super()
    // }
    render() {
        return (
            <div className="profile">
                <div className='item'>
                    <img className="img" src="https://via.placeholder.com/730x400.png?text=Profile+Image+goes+here" alt="shit" />
                </div>
                <div className='item'>Character Name goes here</div>
                <div className='item'>Biogrophy, or some shit</div>
                <div className='item'><ComicList /></div>
            </div>
        );
    };
}

export default ProfileUI;
